import styled from 'styled-components';

export const Box = styled.div`
  display: flex;
`;

export const InputBox = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px;
  width: 300px;
`;

export const LabelStyled = styled.label`
  display: flex;
  flex-direction: column;
  gap: 5px;
`;

export const InputStyled = styled.input`
  height: 25px;
  border-radius: 5px;
`;
